INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 4.74, 1, 7, 1, 1, 9, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 5, "vo_minigame_1012_result_1079", 2, 12300147);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 0.0, 1, 1, 1, 1, 9, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 5, "vo_minigame_1012_result_1080", 2, 12300148);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 2.21, 2, 8, 1, 1, 9, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 5, "vo_minigame_1012_result_1081", 2, 12300149);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 2.46, 2, 3, 1, 1, 9, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 5, "vo_minigame_1012_result_1082", 2, 12300150);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 2.94, 2, 3, 1, 1, 9, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 5, "vo_minigame_1012_result_1083", 2, 12300151);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 4.19, 3, 7, 1, 1, 9, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 5, "vo_minigame_1012_result_1084", 2, 12300152);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 0.0, 3, 1, 1, 1, 9, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 5, "vo_minigame_1012_result_1085", 2, 12300153);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 2.63, 3, 3, 1, 1, 9, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 5, "vo_minigame_1012_result_1086", 2, 12300154);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 5.53, 1, 3, 1, 1, 4, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1, "vo_minigame_1012_result_1087", 2, 12300155);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (9, 3001, 0.01, 1, 3, 1, 3, 4, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1, "vo_minigame_1012_result_1088", 2, 12300156);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3, 3001, 4.15, 1, 3, 1, 1, 4, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 1, "vo_minigame_1012_result_1089", 2, 12300157);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (9, 3001, 0.01, 2, 9, 1, 9, 4, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 1, "vo_minigame_1012_result_1090", 2, 12300158);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 5.37, 2, 3, 1, 1, 4, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 1, "vo_minigame_1012_result_1091", 2, 12300159);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 1.44, 2, 3, 1, 1, 4, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1, "vo_minigame_1012_result_1092", 2, 12300160);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 0.0, 3, 3, 1, 3, 4, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 1, "vo_minigame_1012_result_1093", 2, 12300161);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3, 3001, 2.91, 3, 3, 1, 9, 4, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 1, "vo_minigame_1012_result_1094", 2, 12300162);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 2.61, 3, 5, 1, 1, 4, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 1, "vo_minigame_1012_result_1095", 2, 12300163);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (1, 3001, 3.63, 1, 4, 1, 2, 0, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 0, "vo_minigame_1012_result_1096", 2, 12300164);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (1, 3001, 4.16, 1, 6, 1, 2, 0, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 0, "vo_minigame_1012_result_1097", 2, 12300165);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (6, 3001, 0.01, 1, 3, 1, 3, 0, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 0, "vo_minigame_1012_result_1098", 2, 12300166);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0, 3001, 5.75, 2, 6, 1, 2, 0, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 0, "vo_minigame_1012_result_1099", 2, 12300167);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (1, 3001, 5.64, 2, 4, 1, 2, 0, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 0, "vo_minigame_1012_result_1100", 2, 12300168);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (8, 3001, 5.73, 2, 8, 1, 4, 0, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 0, "vo_minigame_1012_result_1101", 2, 12300169);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (1, 3001, 5.32, 3, 5, 1, 3, 0, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 0, "vo_minigame_1012_result_1102", 2, 12300170);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (9, 3001, 2.37, 3, 3, 1, 9, 0, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 0, "vo_minigame_1012_result_1103", 2, 12300171);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3, 3001, 4.25, 3, 9, 1, 1, 0, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 0, "vo_minigame_1012_result_1104", 2, 12300172);
