INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (6, 3001, 0.01, 1, 4, 2, 4, 4, "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？", 1, "vo_minigame_1012_result_2088", 2, 22300156);
